import './App.css';
import ReactPlayer from 'react-player';

function App() {
  return (
    <div className="App">
        <img src="http://192.168.1.61:5412/feed" width="720" height="480"/>
        <br></br>
        <br></br>
        <br></br>
        <table className="buttons">
          <tr>
            <td><button type="button" className="btn">ON</button></td>
            <td><button type="button" className="btn">OFF</button></td>
          </tr>
        </table>
    </div>
  );
}

export default App;
